The '''Temple of Marimbo Dungeon''' is found under the [[Temple of Marimbo]], on [[Ape Atoll]]. It can be entered through the trapdoor found at the east end on the {{FloorNumber|uk=0}} of the temple.

The dungeon is composed of three distinct parts. The first area is visited during [[Monkey Madness I]], in which the player makes [[m'speak amulet]]s with one of the two [[wall of flame]]s. This area contains some [[Monkey Zombie]]s and [[spider]]s. Large monkey zombies are found on the upper area, spiders are found in the lower area, and small monkey zombies are found all over the cave.

A small crevice in the middle of the first area leads to a small cave with a long, hot rock on which players may cook [[stuffed snake]]s for the [[Freeing Awowogei|Awowogei]] portion of [[Recipe for Disaster]]. However, a line of hot rocks blocks the players' way, and would burn their feet for rapid 10 [[hitpoints]]. Players must hold a [[zombie monkey greegree]] to pass this.

West of the first area is a small tunnel filled with traps and a few more monkey zombies, which leads to a wooden door that cannot be opened or even examined. Beyond the door is a large cave crawling with monkey zombies, as well as an inaccessible [[monkey skull]] that can only be obtained after completing the hard [[Western Provinces Diary]].

